# ===============================
# EMBEDDED WEB SERVER
# ===============================
server.port=8080
server.address=192.168.0.101
#server.address=46.160.84.84
server.servlet.context-path=/shop
# ===============================
# DATABASE
# ===============================
spring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver
spring.datasource.url=jdbc:mysql://127.0.0.1:3306/spring_react_shop?serverTimezone=UTC&useSSL=false
spring.datasource.username=root
spring.datasource.password=root
# ===============================
# JPA / HIBERNATE
# ===============================
spring.jpa.show-sql=true
spring.jpa.hibernate.ddl-auto=create-drop
spring.jpa.properties.hibernate.dialect=org.hibernate.dialect.MySQL57Dialect
spring.jpa.hibernate.naming-strategy=org.hibernate.cfg.ImprovedNamingStrategy
# ===============================
# Document-based Database - MongoDB
# ===============================
spring.data.mongodb.host=127.0.0.1
spring.data.mongodb.port=27017
spring.data.mongodb.database=broker-shop

# ===============================
# TEST DATA
# ===============================
tests.unit.strings.image-base64-msft=data:image/png;base64,
tests.unit.strings.image-base64-orcl=data:image/png;base64,
tests.unit.strings.image-base64-eth=data:image/jpeg;base64,
